import React, { Component, lazy, Suspense } from "react";
// import ThumbNail from "../thumbnail/thumbnail";

import LgThumbNail from "../lg-thumbnail/lg-thumbnail";
import NavBar from "../navbar/nav-bar";
import "../../style-sheets/portfolio.css";
import Helmet from "react-helmet";

import FooterNav from "../footer-nav/footer-nav";
import data from "../../data/project-data.json";
import images from "../../data/projects/barteranything";

const ThumbNail = lazy(() => import("../thumbnail/thumbnail"));

class Projects extends Component {
	constructor(props) {
		super(props);
		this.state = {
			//State holds all UX the data for the <ThumbNail /> component. This is passed as a Prop.
			selected: 0,
			dataFromThumbnail: 0,
			projects: data,
		};
	}

	componentDidMount() {
		fetch(
			"https://gmo-portfolio.s3.eu-west-2.amazonaws.com/json/project-data.json"
		)
			.then((res) => res.json())
			.then((json) => this.setState({ projects: json }));
	}

	getData = (data) => {
		//Gets data on specified Thumbnail and sends data to be rendered as Lg-Thumbnail
		this.setState({ selected: 1, dataFromThumbnail: data });
	};

	handleCloseLgThumbnail = (update) => {
		console.log("from lg-thumbnail", update);
		this.setState({ selected: update });
	};

	render() {
		const { projects, selected, dataFromThumbnail } = this.state;

		return (
			<>
			{console.log({images})}
				<Helmet>
					<title>Portfolio - Projects</title>
					<meta name="description" content="Portfolio Projects" />
					<link rel="icon" href="#" />
				</Helmet>
				<>
					<div className={"page-wrapper"}>
						<div className="page-width">
							{selected ? (
								<>
									{/* This is used to render single page items on Pop up or nav dropdown selections*/}
									<header>
										<NavBar />
									</header>
									<main className={"main-wrapper"}>
										<h1 className="h1">Projects</h1>
										<h3>2019</h3>
										<LgThumbNail
											dataFromThumbnail={
												dataFromThumbnail
											}
											closeLgThumbnail={
												this.handleCloseLgThumbnail
											}
										/>
										<section
											className={"elements-wrapper"}
										></section>
										<section className={"elements-wrapper"}>
											{projects.map((project) => (
												//data is exported before reaching ThumbNail as ThumbNail will accept data from multiple sources - therefore must be generic.
												<Suspense
													fallback={
														<div className="thumbnail-page-wrapper fade">
															Loading...
														</div>
													}
												>
													<ThumbNail
														key={project.key}
														id={project.id}
														type={project.type}
														img={project.img}
														name={project.name}
														desc={project.desc}
														role={project.role}
														tech={project.tech}
														challenge={
															project.challenge
														}
														solution={
															project.solution
														}
														source={project.source}
														getData={this.getData}
														getData={this.getData}
													/>
												</Suspense>
											))}
										</section>
									</main>
									<FooterNav />
								</>
							) : (
								<>
									{/* This is used to render large pop modal items on click*/}

									<header>
										<NavBar />
									</header>
									<main className={"main-wrapper"}>
										<h1>Projects</h1>
										<h3>2019</h3>
										<section className={"elements-wrapper"}>
											{projects.map((project) => (
												//data is exported before reaching ThumbNail as ThumbNail will accept data from multiple sources - therefore must be generic.
												<Suspense
													fallback={
														<div className="thumbnail-page-wrapper fade">
															Loading...
														</div>
													}
												>
												<ThumbNail
													key={project.key}
													id={project.id}
													type={project.type}
													img={project.img}
													name={project.name}
													desc={project.desc}
													role={project.role}
													tech={project.tech}
													challenge={
														project.challenge
													}
													solution={project.solution}
													source={project.source}
													getData={this.getData}
													getData={this.getData}
												/>
												</Suspense>
											))}
										</section>
									</main>
									<FooterNav isFooter={true} />
								</>
							)}
						</div>
					</div>
				</>
			</>
		);
	}
}

export default Projects;
